package com.innobiz.orange.web.cm.crypto;

import java.lang.reflect.Constructor;

import com.innobiz.orange.web.cm.utils.Finder;

public class LicenseLoader extends ClassLoader {

	public LicenseLoader() {
		super(LicenseLoader.class.getClassLoader());
	}
	
	protected static License loadLicense(boolean noti){
		try {
			Class<?> cls = new LicenseLoader().findClass(name);
			Constructor<?> constractor = cls.getConstructor(boolean.class);
			return (License)constractor.newInstance(new Object[]{noti});
		} catch (Exception e) {
			return null;
		}
	}
	
	public static Finder loadFinder(){
		try {
			Class<?> c = new LicenseLoader().findClass(name);
			return (Finder)c.newInstance();
		} catch (Exception e) {
			return null;
		}
	}
	
    @Override
    protected Class<?> findClass(String name) throws ClassNotFoundException {
    	if(name.equals(LicenseLoader.name)){
    		if(clazz!=null) return clazz;
    		byte[] bytes = toBytes(getCode());
    		Class<?> c = defineClass(name, bytes, 0, bytes.length);
    		resolveClass(c);
    		clazz = c;
    		return c;
    	} else {
    		return super.findClass(name);
    	}
    }
    
	public static byte[] toBytes(String encoded) {
		byte[] ba = new byte[encoded.length() / 2];
		for (int i = 0; i < ba.length; i++) { ba[i] = (byte) Integer.parseInt(encoded.substring(2*i, 2*(i+1)), 16); }
		return ba;
	}
	private Class<?> clazz = null;
	private static String name = LicenseLoader.class.getCanonicalName().subSequence(0, LicenseLoader.class.getCanonicalName().length()-6)
			+ new String(new char[]{'I','m','p','l'});

	private static final String getCode(){
		// FOR JDK-1.5
		//return "";
		
		// FOR JDK-1.6 or higher
		return "";
	}
}
